INSERT INTO `creature_text` VALUES (200403, 3, 0, 'Из ваших останков получаться неплохие игрушки.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200403, 4, 0, 'Берегите спины!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200404, 0, 0, 'Не приближайтесь! Я не хочу навредить вам!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200404, 1, 0, 'Бегите! Иначе замерзнете…', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200404, 2, 0, 'Мне очень жаль. Я не хочу этого делать, но не могу сопротивляться…', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200404, 3, 0, 'Дедушка Зима защитил себя льдом и готовиться применить мощнейшее заклинание, чтобы уничтожить артефакт. Все живое в большом радиусе погибнет!', 41, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200407, 0, 0, 'Альбонд будь ты проклят! Нужно было уничтожить тебя!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200407, 1, 0, 'Но ничего, мое время еще настанет, и тогда вы все падете передо мной.', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200408, 0, 0, 'Наконец-то я очнулся и вправе управлять собой.', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200408, 1, 0, 'Спасибо друзья! Спасибо Альбонд! Что бы я без вас делал, проклятый демон захватил мой разум, я не смог ему противостоять. ', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200408, 2, 0, 'Метцен, как же я соскучился по тебе!', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200408, 3, 0, 'I want to thank you for what you have done for me and all the inhabitants of Azeroth. Take gifts, they are waiting for you!', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200450, 0, 0, 'I am free!', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200450, 1, 0, 'Почувствуй ярость!', 12, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200450, 1, 1, 'Моей ярости нет предела.', 12, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200450, 2, 0, 'Ха-ха! Жалкие куски мяса пришли спасать зверушку.', 12, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200450, 2, 1, 'Отныне здесь не будет праздника!', 12, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200450, 3, 0, 'Повелитель... я подвел... вас...', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200450, 3, 1, 'Вам... не... победить...', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200451, 0, 0, 'Вы спасли меня, герои! Спасибо, теперь я свободен...', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200451, 1, 0, 'Возвращайтесь к Хуан-ди за своей наградой.', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200452, 0, 0, 'Вы спасли меня, герои! Спасибо, теперь я свободен...', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
