INSERT INTO `creature_text` VALUES (200461, 1, 0, 'Возвращайтесь к Хуан-ди за своей наградой.', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200462, 0, 0, 'Вы спасли меня, герои! Спасибо, теперь я свободен...', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200462, 1, 0, 'Возвращайтесь к Хуан-ди за своей наградой.', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200465, 0, 0, 'Азерот не достоин Нового Года! Вам не спасти жалкого духа!', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200465, 1, 0, 'Что, страшно?!', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200465, 1, 1, 'Духи меня боятся, а вы?!', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200465, 2, 0, 'Восстань мой слуга!', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200465, 3, 0, 'НЕЕЕЕЕТ! Это... еще... не конец...', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200465, 3, 1, 'Вы выиграли битву... но не войну!', 14, 0, 0, 1, 0, 0, 0, 0, 0, 0, 'Smart Text');
INSERT INTO `creature_text` VALUES (200500, 0, 0, '1 time', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (200500, 3, 0, '2 time', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 0, 0, 'I\'ll get started on fixin\' it up with stuff I have around the shop.', 12, 0, 0, 0, 0, 0, 105602, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 1, 1, 'Let me just insert this into the core and we\'ll see what happens.', 12, 0, 0, 0, 0, 0, 104804, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 2, 2, 'Flashy, but ineffective. We\'ll have to try something else. Maybe we need a chemical reaction.', 12, 0, 0, 0, 0, 0, 104805, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 3, 3, 'Go to the alchemy shop and ask Deucus for a potion with some punch in it.', 12, 0, 0, 0, 0, 0, 104806, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 4, 4, 'Alright, I\'m going to pour in the solution now. Watch yourself, not sure how this is going to react.', 12, 0, 0, 0, 0, 0, 104807, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 5, 5, 'Are you alright? *Cough, cough* I\'m thinking the only thing that\'s going to work here is a fel-infused core.', 12, 0, 0, 0, 0, 0, 104808, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 6, 6, 'It\'s a long shot, but there may be someone here in Dalaran who has one. Try asking Bonegrim in the Ledgerdemain Lounge if he\'s come across any.', 12, 0, 0, 0, 0, 0, 104809, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 7, 7, 'You found something?! That\'s amazing! You\'re amazing, $n! Keep your fingers crossed, I\'m gonna put it in now.', 12, 0, 0, 0, 0, 0, 104810, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220026, 8, 8, 'Success!', 12, 0, 0, 0, 0, 0, 87235, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220027, 0, 0, 'Alright, let\'s see what we can do with this ore. First things first: we heat the ore.', 12, 0, 100, 0, 0, 0, 98567, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220027, 1, 0, 'Now let\'s see what we can make with it.', 12, 0, 100, 0, 0, 0, 98568, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220027, 2, 0, 'Shaping the ore...', 12, 0, 100, 0, 0, 0, 98591, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220027, 3, 0, 'Look how easily it bends...', 12, 0, 100, 0, 0, 0, 98592, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220027, 4, 0, 'And now for the simple step of applying the flux. Lean in closely and watch my technique.', 12, 0, 100, 0, 0, 0, 98569, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220027, 5, 0, 'Ну, давай-ка посмотрим, что можно сделать с этим доспехом.', 12, 0, 100, 1, 0, 0, 126927, 0, 0, 0, 'Алард Шмид to Player');
INSERT INTO `creature_text` VALUES (220027, 6, 0, 'Сперва надо переплавить всю руду...', 12, 0, 100, 0, 0, 0, 126928, 0, 0, 0, 'Алард Шмид to Player');
INSERT INTO `creature_text` VALUES (220027, 7, 0, 'А теперь хорошенько отковать заготовку из силового камня... вот здесь... и-и-и здесь...', 12, 0, 100, 0, 0, 0, 126929, 0, 0, 0, 'Алард Шмид to Player');
INSERT INTO `creature_text` VALUES (220027, 8, 0, 'И наконец – главная драгоценность!', 12, 0, 100, 0, 0, 0, 126930, 0, 0, 0, 'Алард Шмид to Player');
INSERT INTO `creature_text` VALUES (220027, 9, 0, 'Готово! Одна из лучших моих работ, как по мне! Можешь забирать.', 12, 0, 100, 1, 0, 0, 126931, 0, 0, 0, 'Алард Шмид to Player');
INSERT INTO `creature_text` VALUES (220027, 10, 0, 'Грейсон будет доволен нашей работой. Передай ему мои наилучшие пожелания.', 12, 0, 100, 1, 0, 0, 126932, 0, 0, 0, 'Алард Шмид to Player');
INSERT INTO `creature_text` VALUES (220028, 0, 0, 'The Data Extratinator 3000 might be able to decipher this core. Cross your fingers that it doesn\'t explode in the process.', 12, 0, 100, 1, 0, 0, 98376, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220028, 1, 0, 'This core contains a script written in an ancient Highborne dialect, which I can\'t read. Professor Pallin in the Scribes\' Sacellum may be able to translate this.', 12, 0, 100, 1, 0, 0, 98378, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220029, 0, 0, 'I\'ll meet you down in Azsuna, <name>. Come find me when you discover something.', 12, 0, 100, 1, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220032, 0, 0, 'OOPS! It\'s better this way.', 12, 0, 100, 53, 0, 0, 103936, 0, 0, 0, 'Jabrul to Player');
INSERT INTO `creature_text` VALUES (220032, 0, 0, 'ОЙ! Так ГОРАЗДО лучше.', 12, 0, 100, 53, 0, 0, 103936, 0, 0, 0, 'Джабрул to Player');
INSERT INTO `creature_text` VALUES (220032, 1, 0, 'So that\'s Dalaran? Jabrul is impressed. To the jewelers, here?', 12, 0, 100, 589, 0, 0, 103938, 0, 0, 0, 'Jabrul to Player');
INSERT INTO `creature_text` VALUES (220032, 1, 0, 'Значит, это Даларан? Джабрул поражен. К ювелирам – сюда?', 12, 0, 100, 589, 0, 0, 103938, 0, 0, 0, 'Джабрул to Player');
INSERT INTO `creature_text` VALUES (220032, 2, 0, 'Hi!', 12, 0, 100, 0, 0, 0, 128541, 0, 0, 0, 'Jabrul to Player');
INSERT INTO `creature_text` VALUES (220032, 2, 0, 'Привет!', 12, 0, 100, 0, 0, 0, 128541, 0, 0, 0, 'Джабрул to Player');
INSERT INTO `creature_text` VALUES (220034, 1, 0, 'Дай знать когда будешь $gготов:готова;! И мы вместе пойдем спасать Хранителя Ремула!', 12, 0, 0, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220045, 0, 0, 'Приветствую, |3-6($ct). Пришло время решающего штурма!', 12, 0, 100, 0, 0, 83070, 128995, 0, 0, 0, 'Верховный маг Кадгар to player');
INSERT INTO `creature_text` VALUES (220045, 1, 0, 'Мы разделимся, чтобы атаковать со всех сторон.', 12, 0, 100, 0, 0, 83071, 128997, 0, 0, 0, 'Верховный маг Кадгар to player');
INSERT INTO `creature_text` VALUES (220046, 0, 0, 'Осторожнее там. Ошибки вредны для здоровья – причем в буквальном смысле!', 12, 0, 100, 1, 0, 81376, 124787, 0, 0, 0, 'Верховный маг Ксилем to Player');
INSERT INTO `creature_text` VALUES (220046, 1, 0, 'Может, хватит?! Ну сколько можно?', 12, 0, 100, 603, 0, 81372, 124783, 0, 0, 0, 'Верховный маг Ксилем to Player');
INSERT INTO `creature_text` VALUES (220046, 2, 0, 'Постой-ка... ты же не из моих учеников! Бейте самозванца!', 14, 0, 100, 25, 0, 81709, 124788, 0, 0, 0, 'Верховный маг Ксилем to Player');
INSERT INTO `creature_text` VALUES (220046, 3, 0, 'Студиозусы... в атаку!', 14, 0, 100, 22, 0, 81678, 124789, 0, 0, 0, 'Верховный маг Ксилем to Player');
INSERT INTO `creature_text` VALUES (220046, 4, 0, 'Средоточие сделает меня сильнейшим магом всех времен! Попробуй меня остановить!', 14, 0, 100, 0, 0, 81679, 124798, 0, 0, 0, 'Верховный маг Ксилем to Player');
INSERT INTO `creature_text` VALUES (220046, 5, 0, 'Вижу, сил тебе не занимать – но не пытайся меня остановить!', 12, 0, 100, 0, 0, 81382, 124799, 0, 0, 0, 'Верховный маг Ксилем to Player');
INSERT INTO `creature_text` VALUES (220046, 6, 0, 'Не догонишь! Студиозус Санат, защищай портал любой ценой!', 14, 0, 100, 0, 0, 81680, 124800, 0, 0, 0, 'Верховный маг Ксилем to Player');
INSERT INTO `creature_text` VALUES (220047, 0, 0, 'Отправляйся в Штормхейм. Встретимся в Валдисдалле, а оттуда доберемся до Скольд-Ашиля.', 12, 0, 100, 0, 0, 82939, 128469, 0, 0, 0, 'Сигрин to Player');
INSERT INTO `creature_text` VALUES (220050, 0, 0, 'Стой! Кто идет в склеп Эйир?', 12, 0, 100, 0, 0, 0, 125835, 0, 0, 0, 'Жрица Халла to Player');
INSERT INTO `creature_text` VALUES (220050, 1, 0, 'Наследница Короля-бога? Что за вздор?', 12, 0, 100, 0, 0, 0, 125672, 0, 0, 0, 'Жрица Халла to Player');
INSERT INTO `creature_text` VALUES (220050, 2, 0, 'Погодите-ка... знакомое лицо... Следуй за мной, дитя!', 12, 0, 100, 0, 0, 0, 125673, 0, 0, 0, 'Жрица Халла to Player');
INSERT INTO `creature_text` VALUES (220051, 0, 0, 'Для начала я направлюсь в Хауствальд. Надеюсь, ты составишь мне компанию, $n.', 12, 0, 100, 0, 0, 82873, 125683, 0, 0, 0, 'Сигрин to Player');
INSERT INTO `creature_text` VALUES (220052, 0, 0, 'Теперь мой путь лежит в Хридшал. Увидимся там, |3-6($c).', 12, 0, 100, 0, 0, 82876, 125691, 0, 0, 0, 'Сигрин to Player');
INSERT INTO `creature_text` VALUES (220055, 0, 0, 'Хорошо. Спрашивай.', 12, 0, 100, 1, 0, 81762, 125720, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 1, 0, 'Ох, дитя... не всякая истина – благо. Ты правда хочешь знать?', 12, 0, 100, 1, 0, 81763, 125722, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 2, 0, 'Будь по-твоему. Семью Сковальда приказал истребить сам Один.', 12, 0, 100, 1, 0, 81764, 125724, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 3, 0, 'Один боялся, что наследники Короля-бога предадут Волнскорн в руки Легиона.', 12, 0, 100, 1, 0, 81765, 125726, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 4, 0, 'Потому он повелел истребить их всех до единого.', 12, 0, 100, 1, 0, 81766, 125727, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 5, 0, 'Сигрин! Нет! Не позволяй Тьме поглотить тебя!', 14, 0, 100, 1, 0, 81767, 125729, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 6, 0, 'Сигрин... что ты наделала?', 12, 0, 100, 1, 0, 81768, 125732, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 7, 0, 'Итак, наследница Сковальда вернулась к валькирам. Знаешь, что это значит, дитя?', 12, 0, 100, 1, 0, 81757, 125675, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 8, 0, 'Так и есть. Я давно предвидела, что валькиры сплотят клан Волнскорн против грозного врага, и возглавит его дочь девы щита и Короля-бога.', 12, 0, 100, 0, 0, 81758, 125677, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 9, 0, 'Ты – дочь Сковальда и его наследница. Все, кто оспаривает твое право на трон, должны склониться перед тобой.', 12, 0, 100, 0, 0, 81759, 125678, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 10, 0, 'Если дрогнешь, твой клан расколется, и ничто не помешает Легиону взять Штормхейм.', 12, 0, 100, 0, 0, 81760, 125679, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220055, 11, 0, 'Знаю, это тяжкое бремя, но ты – наша единственная надежда.', 12, 0, 100, 0, 0, 81761, 125680, 0, 0, 0, 'Эйир to Player');
INSERT INTO `creature_text` VALUES (220065, 0, 0, 'Фамбар взял след Левии!', 42, 0, 100, 0, 0, 0, 126802, 0, 0, 0, 'Фамбар to Player');
INSERT INTO `creature_text` VALUES (220065, 1, 0, 'Фамбар что-то учуял...', 42, 0, 100, 0, 0, 0, 128370, 0, 0, 0, 'Фамбар to Player');
INSERT INTO `creature_text` VALUES (220065, 2, 0, 'Фамбар не нашел ничего полезного...', 42, 0, 100, 0, 0, 0, 128371, 0, 0, 0, 'Фамбар to Player');
INSERT INTO `creature_text` VALUES (220070, 0, 0, 'Рат-ану\'танос!', 12, 0, 100, 0, 0, 67511, 100280, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 1, 0, 'Надо соблюдать осторожность. Иссохшие повсюду, и они голодны. Эти существа питаются магией и плотью.', 12, 0, 100, 0, 0, 67512, 114540, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 2, 0, 'Такова судьба ночнорожденных, что не могут испить из Ночного Колодца.', 12, 0, 100, 0, 0, 67513, 100338, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 3, 0, 'Она ждет и меня... Если только не…', 12, 0, 100, 0, 0, 67514, 101935, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 4, 0, 'Берегись!', 12, 0, 100, 0, 0, 67515, 143886, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 5, 0, 'Э\'рат омнас!', 12, 0, 100, 0, 0, 67516, 100340, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 6, 0, 'Барьер истончился!', 12, 0, 100, 0, 0, 67524, 100543, 0, 0, 0, 'Первая чародейка Талисра to Жаждущий иссохший');
INSERT INTO `creature_text` VALUES (220070, 7, 0, 'I am weakening ... Take refuge ...', 12, 0, 100, 0, 0, 67517, 100339, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 8, 0, '<кашляет> Дай мне… минутку.', 12, 0, 100, 0, 0, 67518, 100588, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 10, 0, 'Их так много...', 12, 0, 100, 0, 0, 67519, 100589, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 11, 0, 'Странно, почему они нас не преследуют?', 12, 0, 100, 0, 0, 67520, 100590, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220070, 12, 0, '<кашляет> Нужно отдохнуть...', 12, 0, 100, 0, 0, 67521, 100591, 0, 0, 0, 'Первая чародейка Талисра to Player');
INSERT INTO `creature_text` VALUES (220071, 0, 0, 'Идем! Фал\'\'дорай обитают в руинах под нами.', 12, 0, 100, 0, 0, 67260, 112920, 0, 0, 0, 'Странник дола Фародин to Player');
INSERT INTO `creature_text` VALUES (220071, 1, 0, 'Прыгай вниз, в воду.', 12, 0, 100, 0, 0, 67261, 112921, 0, 0, 0, 'Странник дола Фародин to Player');
INSERT INTO `creature_text` VALUES (220071, 2, 0, 'Скорее, сажай семя!', 12, 0, 100, 0, 0, 67526, 113688, 0, 0, 0, 'Странник дола Фародин to Player');
INSERT INTO `creature_text` VALUES (220071, 3, 0, 'Здесь оно сможет питаться от силовой линии.', 12, 0, 100, 0, 0, 67526, 113689, 0, 0, 0, 'Странник дола Фародин to Player');
INSERT INTO `creature_text` VALUES (220072, 0, 0, 'Нам лучше пройти через сад.', 12, 0, 100, 0, 0, 67506, 108574, 0, 0, 0, 'Силгрин to Player');
INSERT INTO `creature_text` VALUES (220072, 1, 0, 'Зачарованные маски. Просто надень маску, и волшебный костюм возникнет на тебе сам собой.', 12, 0, 100, 0, 0, 67507, 108575, 0, 0, 0, 'Силгрин to Player');
INSERT INTO `creature_text` VALUES (220072, 2, 0, 'Этого должно быть достаточно, чтобы обмануть гостей вечеринки, но вот от охраны лучше держаться подальше.', 12, 0, 100, 0, 0, 67508, 108577, 0, 0, 0, 'Силгрин to Player');
INSERT INTO `creature_text` VALUES (220072, 3, 0, 'Я найду Ли\'лет. А ты жди. И смотри – не лезь на рожон.', 12, 0, 100, 0, 0, 67509, 108576, 0, 0, 0, 'Силгрин to Player');
INSERT INTO `creature_text` VALUES (220072, 4, 0, 'Повеселись немного на вечеринке. Как это... потусуйся!', 12, 0, 100, 0, 0, 67510, 108943, 0, 0, 0, 'Силгрин to Player');
INSERT INTO `creature_text` VALUES (220075, 1, 0, 'Слушаюсь, первая чародейка.', 12, 0, 100, 273, 0, 67257, 105903, 0, 0, 0, 'Чародейка Вальтруа to Player');
INSERT INTO `creature_text` VALUES (220075, 2, 0, 'Идем со мной. Я покажу тебе канал.', 12, 0, 100, 0, 0, 67248, 105904, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220075, 3, 0, 'Ты, видимо, не умеешь обращаться с энергией силовых линий?', 12, 0, 100, 0, 0, 67249, 105906, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220075, 4, 0, 'Позволь обучить тебя основам этого искусства.', 12, 0, 100, 0, 0, 67250, 105907, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220075, 5, 0, 'В толще земли текут реки первобытной тайной магии. Силовые линии неизменны и вечны, они не поддаются контролю.', 12, 0, 100, 0, 0, 67251, 105909, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220075, 6, 0, 'Однако их силу можно извлечь, так же как нить из лоскута ткани.', 12, 0, 100, 0, 0, 67252, 105911, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220075, 7, 0, 'Этот канал тянется из низины Анора. Есть и другие, пока неактивные.', 12, 0, 100, 0, 0, 67253, 105930, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220075, 8, 0, 'Нужно восстановить их, чтобы Шал\'Аран стал средоточием силы.', 12, 0, 100, 0, 0, 67254, 105931, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (220078, 2, 0, 'Двор, из которого мы вышли, открыт для всех. Но дальше тебя без сопровождения не пустят.', 12, 0, 100, 0, 0, 66288, 114978, 0, 0, 0, 'Марго to Player');
INSERT INTO `creature_text` VALUES (220078, 3, 0, 'Можешь купить сувениры у моего помощника Сильверина. Лучше на обратном пути.', 12, 0, 100, 0, 0, 66289, 114979, 0, 0, 0, 'Марго to Player');
INSERT INTO `creature_text` VALUES (220078, 4, 0, 'В этом павильоне происходит дегустация. Подаем только лучшие сорта – многие поставляются во дворец.', 12, 0, 100, 0, 0, 66290, 114980, 0, 0, 0, 'Марго to Player');
INSERT INTO `creature_text` VALUES (220078, 5, 0, 'Попробуй сегодняшние образцы, не стесняйся. Как закончишь, мы продолжим экскурсию.', 12, 0, 100, 0, 0, 66291, 114982, 0, 0, 0, 'Марго to Player');
INSERT INTO `creature_text` VALUES (220087, 0, 0, 'Alright, lad, be on yer guard.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Brann to Player');
INSERT INTO `creature_text` VALUES (220388, 0, 0, 'Мои разведчики нашли останки Аггонара. Мы в долгу перед вами, верховный экзарх.', 12, 0, 100, 396, 0, 87155, 133762, 0, 0, 0, 'Вождь Хатуун to player');
INSERT INTO `creature_text` VALUES (220388, 1, 0, 'Я знаю, что делать. Мы используем силу Аргуса, чтобы помочь вам.', 12, 0, 100, 396, 0, 86340, 131498, 0, 0, 0, 'Вождь Хатуун to player');
INSERT INTO `creature_text` VALUES (220388, 2, 0, 'Мы скрывались. Адаптировались. В час нужды сама земля прислушивается к нашим мольбам.', 12, 0, 100, 396, 0, 86342, 131501, 0, 0, 0, 'Вождь Хатуун to player');
INSERT INTO `creature_text` VALUES (220389, 0, 0, 'Вождь, Легион падет, только если мы объединимся. И сейчас наши друзья в смертельной опасности.', 12, 0, 100, 396, 0, 86339, 131495, 0, 0, 0, 'Вождь Хатуун to player');
INSERT INTO `creature_text` VALUES (220389, 1, 0, 'Тоннель! Вот как вам удалось пережить все эти годы...', 12, 0, 100, 396, 0, 86341, 131499, 0, 0, 0, 'Вождь Хатуун to player');
INSERT INTO `creature_text` VALUES (220389, 2, 0, 'I will go ahead and clear the way. The bridge in front of the \"Xenodar\" is almost not guarded. May the Light abide with us.', 12, 0, 100, 0, 0, 86344, 132159, 0, 0, 0, 'Вождь Хатуун to player');
INSERT INTO `creature_text` VALUES (220390, 0, 0, 'Довольно!', 14, 0, 100, 1, 0, 86511, 129681, 0, 0, 0, 'Верховный экзарх Туралион to 0');
INSERT INTO `creature_text` VALUES (220390, 1, 0, 'Опустите оружие! Пророк и его спутник нам не враги.', 12, 0, 100, 1, 0, 86187, 129683, 0, 0, 0, 'Верховный экзарх Туралион to 0');
INSERT INTO `creature_text` VALUES (220390, 2, 0, 'Только объединив усилия мы сможем хотя бы попытаться победить Легион.\n', 12, 0, 100, 1, 0, 86188, 129692, 0, 0, 0, 'Верховный экзарх Туралион to 0');
INSERT INTO `creature_text` VALUES (230007, 0, 0, 'On this server you are given the opportunity to change the personal rate for the pumping of the character. You can do this at NPC \"Джарвис\", which should be located somewhere nearby, as well as in the capital of your faction!', 42, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (230008, 0, 0, 'Хей, $N, привет! Я твой персональный манекен! Можешь примерить на меня какие-нибудь морфы, если сомневаешься, стоит ли их покупать.', 12, 0, 0, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (230008, 1, 0, 'Вжух!', 12, 0, 0, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (230008, 1, 1, 'Оп-ля, посмотри, какая красота!', 12, 0, 0, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (230008, 1, 2, 'Мне нравится этот прикид, а тебе?', 12, 0, 0, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (230018, 0, 0, 'За штормград!', 14, 0, 100, 0, 0, 0, 40630, 0, 0, 0, 'TEST');
INSERT INTO `creature_text` VALUES (230018, 0, 1, 'За Короля!', 14, 0, 100, 0, 0, 0, 99993, 0, 0, 0, 'TEST');
INSERT INTO `creature_text` VALUES (230018, 0, 2, 'Умри, орк!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'TEST');
INSERT INTO `creature_text` VALUES (230019, 0, 0, 'За Оргриммар!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'TEST');
INSERT INTO `creature_text` VALUES (230019, 0, 1, 'За Вождя!', 14, 0, 100, 0, 0, 0, 113532, 0, 0, 0, 'TEST');
INSERT INTO `creature_text` VALUES (230019, 0, 2, 'Умри, человечишка!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'TEST');
INSERT INTO `creature_text` VALUES (231018, 0, 0, 'I am the Raven King! I rose from the dead to stop the Iron Tide!', 14, 0, 100, 0, 0, 46462, 85629, 0, 0, 0, 'Терокк to Player');
INSERT INTO `creature_text` VALUES (231018, 1, 0, 'Ах-х! Не… возможно…', 12, 0, 100, 0, 0, 46463, 85630, 0, 0, 0, 'Терокк to Каргат Острорук');
INSERT INTO `creature_text` VALUES (231018, 2, 0, 'Моя сила… подвела тебя…', 12, 0, 100, 0, 0, 46464, 85632, 0, 0, 0, 'Терокк to Каргат Острорук');
INSERT INTO `creature_text` VALUES (253619, 1, 0, 'Kneel before the burning flame!', 14, 0, 0, 0, 0, 0, 52408, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (254201, 0, 0, '%s Is evading the attack', 16, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (333410, 2, 0, 'Azsharite Core goes critical!', 41, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (344310, 0, 0, 'Everybody on board! This caravan\'s leaving for the Mor\'shan Rampart!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344310, 1, 0, 'How are you doing back there? Not too bumpy I hope.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344310, 2, 0, 'Our enemies wouldn\'t dare attack us this close to the Crossroads. It\'s further out that we\'ll have to watch our backs.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344310, 3, 0, 'My family has been running caravan routes in the Barrens since Orgrimmar was settled. We raise and train the kodos ourselves. My sister Nagala is the best kodo breeder outside of Mulgore.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344310, 4, 0, ' Bet you didn\'t know that a kodo can eat its own weight in grass each day. Sure is a lot to shovel when it comes out the other end.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344310, 5, 0, 'Hope you don\'t mind, but we\'ll stop at Dreadmist Camp to pick up additional supplies and fresh mounts for the last leg of the journey.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344310, 6, 0, 'Nagala will have her famous grilled zhevra chops waiting for us, no doubt. She says I need to cut back and eat more vegetables, but I don\'t think I\'ve gained that much weight...do you?', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344311, 0, 0, 'Good to see you again, friend. Make haste and hop on while the way is still clear.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344311, 1, 0, 'Watch out above us! Use your rocket!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344311, 2, 0, 'Good shooting! That one won\'t be getting up anytime soon.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344311, 3, 0, 'Look sharp! They\'re closing in on our heels!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344311, 4, 0, 'They\'re coming from all sides! Hang on just a little longer - we\'re almost there!', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (344311, 5, 0, 'By the skin of our teeth, we made it! I haven\'t seen shooting like that since...well...ever! I wish we could ride together again, but Kadrak has more important work for you. Thank you for delivering us safely, my friend.', 12, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Balgor WhipshankÂ ');
INSERT INTO `creature_text` VALUES (346700, 0, 0, 'Hold it, $R! I promised told ye where the treasure is, but never promised ye could keep it!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (393410, 0, 0, 'The Azsharite Core is Overheating - use the Fireliminator to cool it!', 41, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (393410, 1, 0, 'Azsharite Core at 60 percent integrity...', 41, 0, 100, 0, 0, 0, 0, 0, 0, 0, '');
INSERT INTO `creature_text` VALUES (395820, 0, 0, 'I SEE THE TRAITOR IS HERE TO RESCUE YOU, WARCHIEF. HOW CONVENIENT. YOU WILL BOTH BOW TO ME OR FALL TOGETHER!', 14, 0, 100, 0, 0, 19567, 0, 0, 0, 0, 'Торговый принц Галливикс');
INSERT INTO `creature_text` VALUES (395820, 5, 1, 'Gotta trim some fat around here. I\'m downsizing the company!', 14, 0, 100, 0, 0, 19573, 0, 0, 0, 0, 'Downsizing ');
INSERT INTO `creature_text` VALUES (395820, 5, 2, 'I\'m downsizing the cartel, starting with you!', 14, 0, 100, 0, 0, 19571, 0, 0, 0, 0, 'Downsizing ');
INSERT INTO `creature_text` VALUES (395820, 6, 0, 'Here\'s some of that moolah back that I took from you!', 14, 0, 100, 0, 0, 19577, 0, 0, 0, 0, 'Revenue Stream');
INSERT INTO `creature_text` VALUES (395820, 6, 1, 'I like you. Here\'s a raise!', 14, 0, 100, 0, 0, 19578, 0, 0, 0, 0, 'Revenue Stream');
INSERT INTO `creature_text` VALUES (395820, 7, 0, 'Excuse me while I dispose of these toxic assets all over you!', 14, 0, 100, 0, 0, 19569, 0, 0, 0, 0, 'Unload Toxic Assets ');
INSERT INTO `creature_text` VALUES (395820, 7, 1, 'I need to move these toxic assets onto a sucker... like you!', 14, 0, 100, 0, 0, 19570, 0, 0, 0, 0, 'Unload Toxic Assets ');
INSERT INTO `creature_text` VALUES (395820, 8, 0, 'You\'re fired!', 14, 0, 100, 0, 0, 19574, 0, 0, 0, 0, 'You\'re Fired ');
INSERT INTO `creature_text` VALUES (395820, 8, 1, 'I\'m all fired up over finally gettin\' rid of you!', 14, 0, 100, 0, 0, 19575, 0, 0, 0, 0, 'You\'re Fired ');
INSERT INTO `creature_text` VALUES (423070, 0, 0, 'The sun has set on this mortal world, fools. Make peace with your end, for the hour of twilight falls!', 14, 0, 100, 0, 0, 23228, 0, 0, 0, 0, '');
