INSERT INTO `creature_text` VALUES (950116, 0, 0, 'Так держать! Продолжайте!', 14, 0, 100, 0, 0, 44884, 84590, 0, 0, 0, 'Верховный маг Кадгар to Player');
INSERT INTO `creature_text` VALUES (950116, 0, 1, 'Бейтесь за Азерот! За все, что вам дорого!', 14, 0, 100, 0, 0, 58945, 109609, 0, 0, 0, 'Верховный маг Кадгар to Верховный маг Кадгар');
INSERT INTO `creature_text` VALUES (950116, 0, 2, 'Скорей! Убьем чудищ, пока они никого не сожрали.', 14, 0, 100, 1, 0, 66564, 113358, 0, 0, 0, 'Верховный маг Кадгар to Player');
INSERT INTO `creature_text` VALUES (950116, 0, 3, 'Мы так легко не сдадимся!', 14, 0, 100, 0, 0, 50404, 93605, 0, 0, 0, 'Верховный маг Кадгар to Бес адского огня');
INSERT INTO `creature_text` VALUES (950116, 0, 4, 'ЗА АЗЕРОТ!', 14, 0, 100, 0, 0, 50632, 135754, 0, 0, 0, 'Верховный маг Кадгар to Player');
INSERT INTO `creature_text` VALUES (950116, 1, 0, 'Скажу банальность, но будьте начеку. Я ощущаю присутствие чего-то... из давнего прошлого...', 12, 0, 100, 25, 0, 78190, 124010, 0, 0, 0, 'Верховный маг Кадгар to Player');
INSERT INTO `creature_text` VALUES (950116, 2, 0, 'У нас очень мало времени! Все на возвышенность!', 14, 0, 100, 0, 0, 44887, 83385, 67790, 67790, 0, 'Верховный маг Кадгар to Player');
INSERT INTO `creature_text` VALUES (950116, 3, 0, 'Все. Вы в безопасности.', 12, 0, 100, 1, 0, 49609, 92788, 297000, 297000, 0, 'Верховный маг Кадгар to Player');
INSERT INTO `creature_text` VALUES (950116, 4, 0, 'Легион не получит наш мир!', 14, 0, 100, 0, 0, 58947, 109611, 0, 0, 0, 'Верховный маг Кадгар to 0');
INSERT INTO `creature_text` VALUES (950117, 0, 0, 'Что же делать нам?!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Верховный маг Кадгар to Верховный маг Кадгар');
INSERT INTO `creature_text` VALUES (950117, 1, 0, 'Вы можете нам помочь?', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Верховный маг Кадгар to Верховный маг Кадгар');
INSERT INTO `creature_text` VALUES (950117, 2, 0, 'Спасите нас, мы же не можем сражаться!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Верховный маг Кадгар to Верховный маг Кадгар');
INSERT INTO `creature_text` VALUES (950117, 3, 0, 'Спрячьте нас в безопасном месте!', 14, 0, 100, 0, 0, 0, 0, 0, 0, 0, 'Верховный маг Кадгар to Верховный маг Кадгар');
INSERT INTO `creature_text` VALUES (950119, 0, 0, 'I will destroy this miserable world! His remains will be scattered around the Twisting Nether!', 14, 0, 100, 0, 0, 50659, 94782, 0, 0, 0, 'Архимонд to Архимонд');
