INSERT INTO `custom_texts` VALUES (-2000364, 'Focus all attacks on one slug!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Сосредоточьте все атаки на одном слизне!', NULL, NULL, 0, 3, 0, 0, 'Call Blood of Shu\'Ma emote');
INSERT INTO `custom_texts` VALUES (-2000363, '%s summons%s,%s and%s drops of Shu\'ma blood!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '%s призывает %s, %s и %s капли крови Шу\'мы!', NULL, NULL, 0, 3, 0, 0, 'Call Blood of Shu\'Ma emote');
INSERT INTO `custom_texts` VALUES (-2000362, 'O, Deathwing! Your faithful servant has failed you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'О Смертокрыл! Твой верный слуга подвел тебя!', NULL, NULL, 0, 4, 0, 0, 'Death whisper');
INSERT INTO `custom_texts` VALUES (-2000361, 'Ez, Shuul\'wah! Sk\'woth\'gl yu\'gaz yog\'ghyl ilfah!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Эз, Шуул\'уах! Ск\'вот\'гл ю\'газ ех\'гыл иилт!', NULL, NULL, 26327, 6, 0, 0, 'Death yell');
INSERT INTO `custom_texts` VALUES (-2000360, 'From its BLEAKEST DEPTHS, we RECLAIM this world!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Мы пришли из МРАЧНЕЙШИХ ГЛУБИН этого мира, чтобы СНОВА ПРАВИТЬ им!', NULL, NULL, 0, 4, 0, 0, 'Killing a player whisper 3');
INSERT INTO `custom_texts` VALUES (-2000359, 'All praise Deathwing, THE DESTROYER!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Слава Смертокрылу, РАЗРУШИТЕЛЮ!', NULL, NULL, 0, 4, 0, 0, 'Killing a player whisper 2');
INSERT INTO `custom_texts` VALUES (-2000358, 'Your soul will know ENDLESS TORMENT!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'БЕСКОНЕЧНЫЕ МУЧЕНИЯ ждут твою душу!', NULL, NULL, 0, 4, 0, 0, 'Killing a player whisper 1');
INSERT INTO `custom_texts` VALUES (-2000357, 'Shkul an\'zig qvsakf KSSH\'GA, ag\'THYZAK agthu!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Шкул ан\'циг кувсакф КШШ\'ГА, аг\'ТЫЦАК агту!', NULL, NULL, 26331, 6, 0, 0, 'Killing a player yell 3');
INSERT INTO `custom_texts` VALUES (-2000356, 'H\'iwn zaix Shuul\'wah, PHQUATHI!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 6, 0, 0, 'Killing a player yell 2');
INSERT INTO `custom_texts` VALUES (-2000355, 'Sk\'yahf qi\'plahf PH\'MAGG!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 6, 0, 0, 'Killing a player yell 1');
INSERT INTO `custom_texts` VALUES (-2000354, 'The DARKNESS devours ALL!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ТЬМА пожрет ВСЕ!', NULL, NULL, 0, 4, 0, 0, 'Call Blood of Shu\'Ma whisper 2');
INSERT INTO `custom_texts` VALUES (-2000353, 'SEE how we pour from the CURSED EARTH!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'УЗРИ же, как мы черпаем мощь из ПРОКЛЯТОЙ ЗЕМЛИ!', NULL, NULL, 0, 4, 0, 0, 'Call Blood of Shu\'Ma whisper 1');
INSERT INTO `custom_texts` VALUES (-2000352, 'UULL lwhuk H\'IWN!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 6, 0, 0, 'Call Blood of Shu\'Ma yell 2');
INSERT INTO `custom_texts` VALUES (-2000351, 'KYTH ag\'xig yyg\'far IIQAATH ONGG!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'КИТ аг\'зиг ыыг\'фар ИИКУААТ ОНГГ!', NULL, NULL, 26332, 6, 0, 0, 'Call Blood of Shu\'Ma yell 1');
INSERT INTO `custom_texts` VALUES (-2000350, 'You will drown in the blood of the Old Gods! ALL OF YOU!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы утонете в крови древних богов! ВСЕ ВЫ!', NULL, NULL, 0, 4, 0, 0, 'Aggro whisper');
INSERT INTO `custom_texts` VALUES (-2000349, 'Iilth qi\'uothk shn\'ma yeh\'glu Shath\'Yar! H\'IWN IILTH!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Иилт ки\'уотк шн\'ма йе\'глу Шат\'Яр! Х\'ИУН ИИЛТ!', NULL, NULL, 26326, 6, 0, 0, 'Aggro yell');
INSERT INTO `custom_texts` VALUES (-2000348, 'Our numbers are endless, our power beyond reckoning! All who oppose the Destroyer will DIE A THOUSAND DEATHS!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Не счесть нам числа, и нет такой силы, что сможет противостоять нам! Всех, кто противостоит Разрушителю, настигнут ТЫСЯЧИ СМЕРТЕЙ!', NULL, NULL, 0, 4, 0, 0, 'Intro whisper');
INSERT INTO `custom_texts` VALUES (-2000347, 'Ak\'agthshi ma uhnish, ak\'uq shg\'cul vwahuhn! H\'iwn iggksh Phquathi gag OOU KAAXTH SHUUL!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ак\'агтши ма унхиш, ак\'ук шг\'кул ваахухн! Х\'иун иггкш Фквати гаг ООУ КААЗТ ШУУЛ!', NULL, NULL, 0, 6, 0, 0, 'Intro yell');
INSERT INTO `custom_texts` VALUES (-2000346, 'To have waited so long... for this...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Так долго... этого ждать...', NULL, NULL, 0, 4, 0, 0, 'Death whipers');
INSERT INTO `custom_texts` VALUES (-2000345, 'Uovssh thyzz... qwaz...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 6, 0, 0, 'Death yell');
INSERT INTO `custom_texts` VALUES (-2000344, 'Your souls shall sate N\'Zoth\'s endless hunger.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ваши души избавят Н\'Зота от его вечного голода.', NULL, NULL, 0, 4, 0, 0, 'Killing a player whipers 3');
INSERT INTO `custom_texts` VALUES (-2000343, 'Your deaths shall sing of N\'Zoth\'s unending glory.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ваши смерти – гимн славе Н\'Зота.', NULL, NULL, 0, 4, 0, 0, 'Killing a player whipers 2');
INSERT INTO `custom_texts` VALUES (-2000342, 'Your skulls shall adorn N\'Zoth\'s writhing throne.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ваши черепа украсят трон Н\'Зота.', NULL, NULL, 0, 4, 0, 0, 'Killing a player whipers 1');
INSERT INTO `custom_texts` VALUES (-2000341, 'Sk\'yahf agth huqth N\'Zoth qornaus.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 26339, 6, 0, 0, 'Killing a player yell 3');
INSERT INTO `custom_texts` VALUES (-2000340, 'Sk\'shuul agth vorzz N\'Zoth naggwa\'fssh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 6, 0, 0, 'Killing a player yell 2');
INSERT INTO `custom_texts` VALUES (-2000339, 'Sk\'tek agth nuq N\'Zoth yyqzz.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 6, 0, 0, 'Killing a player yell 1');
INSERT INTO `custom_texts` VALUES (-2000338, 'Gaze into the heart of N\'Zoth.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вглядись же в сердце Н\'Зота...', NULL, NULL, 0, 4, 0, 0, 'Void of the Unmaking whipers');
INSERT INTO `custom_texts` VALUES (-2000337, 'Gul\'kafh an\'qov N\'Zoth.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 26343, 6, 0, 0, 'Void of the Unmaking yell');
INSERT INTO `custom_texts` VALUES (-2000336, 'The will of N\'Zoth corrupts you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Воля Н\'Зота оскверняет тебя.', NULL, NULL, 0, 4, 0, 0, 'Black Blood of Go\'rath whipers');
INSERT INTO `custom_texts` VALUES (-2000335, 'N\'Zoth ga zyqtahg iilth.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 26344, 6, 0, 0, 'Black Blood of Go\'rath yell');
INSERT INTO `custom_texts` VALUES (-2000334, 'Your agony sustains me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Твоя агония придает мне силы.', NULL, NULL, 0, 4, 0, 0, 'Disrupting Shadows whipers 3');
INSERT INTO `custom_texts` VALUES (-2000333, 'Your suffering strengthens me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Твои страдания – моя мощь.', NULL, NULL, 0, 4, 0, 0, 'Disrupting Shadows whipers 2');
INSERT INTO `custom_texts` VALUES (-2000332, 'Your fear drives me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Твой страх движет мной.', NULL, NULL, 0, 4, 0, 0, 'Disrupting Shadows whipers 1');
INSERT INTO `custom_texts` VALUES (-2000331, 'Sk\'uuyat guulphg hoq.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 26342, 6, 0, 0, 'Disrupting Shadows yell 3');
INSERT INTO `custom_texts` VALUES (-2000330, 'Sk\'magg yawifk hoq.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 26340, 6, 0, 0, 'Disrupting Shadows yell 2');
INSERT INTO `custom_texts` VALUES (-2000329, 'Sk\'shgn eqnizz hoq.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 26343, 6, 0, 0, 'Disrupting Shadows yell 1');
INSERT INTO `custom_texts` VALUES (-2000328, 'Victory for Deathwing. For the glory of N\'Zoth!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Победа во имя Смертокрыла. Во славу Н\'Зота!', NULL, NULL, 0, 4, 0, 0, 'Aggro Whisper');
INSERT INTO `custom_texts` VALUES (-2000327, 'Zzof Shuul\'wah. Thoq fssh N\'Zoth!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 26335, 6, 0, 0, 'Aggro Yell');
INSERT INTO `custom_texts` VALUES (-2000326, 'Once more shall the twisted flesh-banners of N\'Zoth chitter and howl above the fly-blown corpse of this world. After millennia, we have returned.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вновь взовьются над трупом этого мира сотканные из живой плоти знамена Н\'Зота. Мы вернулись – спустя тысячелетия.', NULL, NULL, 0, 4, 0, 0, 'Intro whisper');
INSERT INTO `custom_texts` VALUES (-2000325, 'Vwyq agth sshoq\'meg N\'Zoth vra zz shfk qwor ga\'halahs agthu. Uulg\'ma, ag qam.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 6, 0, 0, 'Intro yell');
INSERT INTO `custom_texts` VALUES (-2000312, 'You thought to fight me alone? The earth splits to swallow and crush you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы думали, что я буду сражаться один? Земля разделится и поглотит вас.', NULL, NULL, 26269, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000311, 'Impossible. This cannot be. The tower... must... fall...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Этого не может быть. Башня... должна быть... разрушена...', NULL, NULL, 26269, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000310, '...and there is no escape from the Old Gods.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '…и нет спасения от гнева древних богов.', NULL, NULL, 26279, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000309, 'The stone calls...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Земля взывает...', NULL, NULL, 26274, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000308, 'The rocks tremble...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Камни дрожат...', NULL, NULL, 26276, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000307, 'Ground to dust.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Бегите, и вам конец.', NULL, NULL, 26284, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000306, '%s призывает резонирующий кристалл!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '%s призывает резонирующий кристалл!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000305, 'Ground to dust.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Прах к праху.', NULL, NULL, 26287, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000304, 'You seek to halt an avalanche. I will bury you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Попробуйте остановить лавину и умрете.', NULL, NULL, 26268, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000303, 'I will turn this tower to rubble, and scatter it across the wastes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я превращу эту башню в пыль и развею ее по пустошам.', NULL, NULL, 26272, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000302, 'The tower must be fall.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Башня должна быть разрушена. Все обратится в пыль.', NULL, NULL, 26273, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000301, 'Cowards. Weaklings. Come down and fight, or I will bring you down.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Трусы. Слабаки. Спускайтесь вниз и сражайтесь.', NULL, NULL, 26270, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000300, 'No mortal shall turn me from my task.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ни один смертный не сможет мне помешать.', NULL, NULL, 26282, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000243, 'You did well, but for now I must continue alone. Good hunting.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы помогли мне, но дальше я должен идти один. Удачной охоты!', NULL, NULL, 26052, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000242, 'The hunter became the prey.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Охотник стал добычей.', NULL, NULL, 26051, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000241, 'Nooooo... how can this be?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'НЕТ! Как это возможно?!', NULL, NULL, 26113, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000240, 'ENOUGH! It is time to end this game!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ХВАТИТ! Эта игра мне надоела!', NULL, NULL, 26117, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000239, 'My strength returns.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Силы возвращаются ко мне.', NULL, NULL, 26102, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000238, '%s attacks his helpless victim!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '%s набрасывается на свою беспомощную жертву!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000237, 'I can see you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я тебя вижу.', NULL, NULL, 26122, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000236, 'Вас разыскивают Очи Перот\'арна.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вас разыскивают Очи Перот\'арна.', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000235, 'Cower in hiding, heh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Прячьтесь и дрожите от страха.', NULL, NULL, 26126, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000234, 'Return to the shadows!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Скорее, обратно в тени!', NULL, NULL, 26048, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000233, '%s растворяется в тенях!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '%s растворяется в тенях!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000232, 'The shadows serve ME, now...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Теперь тени служат мне…', NULL, NULL, 26133, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000231, 'Your magic is pathetic. Let me show you mine.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Твоя жалкая магия не сравнится с моей.', NULL, NULL, 26053, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000230, 'Your essence... is MINE.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ваша сущность принадлежит мне.', NULL, NULL, 26132, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000229, 'Nothing will stop me. Not even you, demon.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ничто не остановит меня. Даже ты, демон.', NULL, NULL, 26049, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000228, 'No mortal may stand before me and live!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ни один смертный не сможет противостоять мне!', NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000227, 'None will reach the palace without besting Peroth\'arn, first of fel-touched!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Никто не войдет во дворец, не победив Перот\'арна, первого, кто причастился Скверны!', NULL, NULL, 26128, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000226, 'Another demon, ready to be slaughtered.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Еще одному демону не терпится умереть.', NULL, NULL, 26050, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000225, 'Too easy.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Слишком просто.', NULL, NULL, 26075, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000224, 'The demons are no longer pouring from the palace. We can move ahead.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Поток демонов из дворца, похоже, прекратился. Мы можем двигаться дальше.', NULL, NULL, 26074, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000223, 'Who shut down the portals? Clever little worms.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Кто закрыл порталы? Ах вы, пронырливые создания!', NULL, NULL, 26127, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000222, 'The demons should all be leaving. We will be at the palace in no time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Похоже, все демоны ушли в порталы. Мы почти во дворце!', NULL, NULL, 26073, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000221, 'My blades hunger.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Мои клинки жаждут крови.', NULL, NULL, 26057, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000220, 'They stand unaware that their deaths are moments away.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Они даже не подозревают, что смерть стоит у них за спиной.', NULL, NULL, 26101, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000219, 'Let us shut down this final portal and finish this.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Закройте последний портал и покончим с этим.', NULL, NULL, 26072, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000218, 'The stench of sulfur and brimstone... These portals are as foul as the demons themselves.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Этот запах серы... Порталы так же отвратительны, как и демоны, что их создали.', NULL, NULL, 26070, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000217, 'I\'ll let you have the first kill. Don\'t make me regret that.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ваш удар - первый! Надеюсь, я не буду сожалеть об этом?', NULL, NULL, 26056, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000216, 'The portal is closing! Hurry!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Портал закрывается! Быстрее!', NULL, NULL, 26037, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000215, 'They come endlessly from the palace.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Им нет числа…', NULL, NULL, 26069, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000214, 'We\'re leaving. Stay close.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Все, уходим. Не отставайте.', NULL, NULL, 26055, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000213, 'There! Go! GO!!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'В портал! Вперед! ВПЕРЕД!!!', NULL, NULL, 26038, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000212, 'Smash the crystal. We need to move.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Разбейте кристалл. Надо двигаться дальше!', NULL, NULL, 26104, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000211, 'Death to the Legion!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Смерть Легиону!', NULL, NULL, 26056, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000210, 'My magic is fading. I\'m going through!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Моя магия слабеет. Нужно идти!', NULL, NULL, 26064, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000209, 'I will hold them back so we can get past. Be ready.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я задержу их. Это даст нам возможность пройти дальше. Приготовьтесь.', NULL, NULL, 26063, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000208, 'I\'ve seen a single Guardian Demon slaughter a hundred elves. Tread lightly.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я видел, как один такой демон расправился с сотней эльфов. Будьте осторожны.', NULL, NULL, 26068, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000207, 'Come with me if you\'d like to live long enough to see me save this world!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Теперь за мной, если хотите дожить до того момента, как я спасу мир!', NULL, NULL, 26065, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000206, 'We now hide in shadows, hidden from our enemies.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Теперь тени скроют нас от врагов.', NULL, NULL, 26054, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000205, 'Talk with me now.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Говорите!', NULL, NULL, 26523, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000204, 'I think we stand a better chance fighting alongside one another.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Думаю, у нас будет больше шансов, если мы будем сражаться вместе.', NULL, NULL, 26525, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000203, 'Over here, in the shadows.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я здесь, под прикрытием теней.', NULL, NULL, 26076, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000202, 'The rest of you, secure the courtyard.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Остальные - охраняйте двор.', NULL, NULL, 26121, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000201, 'You, Felguard. Hold this area.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Felguard ... You will stay here.', NULL, NULL, 26120, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000200, 'He is near, lurking in the shadows... I can sense it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'He’s here somewhere, hiding in the shadows ...', NULL, NULL, 26118, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000177, 'Your time has come.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Твое время истекло.', NULL, NULL, 25937, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000176, 'Your time has come.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Твой час пробил.', NULL, NULL, 25936, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000175, 'Still, in time, I will... fall to madness. And you, heroes... will vanquish me. The cycle will repeat. So it goes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вот он - момент моей смерти. Цикл завершился. Мое будущее воплощение уже не причинит никому зла.', NULL, NULL, 25944, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000174, 'You know not what you have done. Aman\'Thul... What I... have... seen...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Что… вы наделали... Аман\'Тул... Я…видел…', NULL, NULL, 25928, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000173, 'The Hourglass\' power is exhausted. No more games, mortals. Relent, or perish.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Магия часов иссякла. Игра закончилась. Теперь вас ждет смерть.', NULL, NULL, 25933, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000172, 'Again...? Is this your plot, your scheme?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Опять?.. Думаете, настойчивость вам поможет?', NULL, NULL, 25932, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000171, 'Another chance will make no difference. You will fail.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Еще одна попытка ничего не изменит. Вас ждет поражение…', NULL, NULL, 25931, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000170, 'To repeat the same action and expect different results is madness.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Глупо повторять одно и тоже и ожидать другого результата.', NULL, NULL, 25930, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000169, 'The powers of the Hourglass do nothing to me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Магия часов не властна надо мной!', NULL, NULL, 25929, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000168, 'The sand has run out.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Пески времени поглотят тебя.', NULL, NULL, 25937, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000167, 'Mortals! I cannot follow you any further - accept my blessing and use the Hourglass of Time to defeat Murozond!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Смертные! Я не могу сопровождать вас дальше. Используйте песочные часы в бою с Дорнозму!', NULL, NULL, 25943, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000166, 'So be it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Да будет так.', NULL, NULL, 25927, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000165, 'You crawl unwitting, like a blind, writhing worm, towards endless madness and despair. I have witnessed the true End Time. This? This is a blessing you simply cannot comprehend.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы как слепые черви ползете к безумию и безысходности. Я видел истинный Конец Времен. Этот исход? О, это – счастье, непостижимое для вас.', NULL, NULL, 25935, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000164, 'The \"End Time,\" I once called this place. I had not seen, by then; I did not know. You hope to... what? Stop me, here? Change the fate I worked so tirelessly to weave?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Однажды я назвал это место \"Концом Времен\". Я еще не видел тогда... я не знал. Что вы надеетесь сделать? Остановить меня? Изменить судьбу, которую я ткал столь неустанно?', NULL, NULL, 25934, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000163, 'A pillar of dark moonlight appears nearby!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Рядом появляется столп темного лунного света!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000162, 'A pillar of moonlight appears in the north!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'На севере появляется столп лунного света!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000161, 'You have chosen the path of Darkness. Moon Goddess, direct my hand! Let me grant peace to these lost souls.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы выбрали путь Тьмы. Богиня-луна, направь мою руку! Позволь мне даровать покой этим заблудшим душам.', NULL, NULL, 25981, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000160, 'A pillar of moonlight appears in the east!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'На востоке появляется столп лунного света!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000159, 'Trust in the night, and Elune will lead you out of this prison.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Доверьтесь ночи, и Элуна выведет вас из этой темницы.', NULL, NULL, 25980, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000158, 'A pillar of moonlight appears in the south!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'На юге появляется столп лунного света!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000157, 'Moonlight gives you peace in this forgotten place.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Лунный свет дарует вам покой в этом забытом месте.', NULL, NULL, 25979, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000156, 'A pillar of moonlight appears in the west!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'На западе появляется столп лунного света!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000155, 'Darkness surrounds you, and only in the light of Elune will you gain salvation.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вас окружает тьма, и лишь в свете Элуны вы обретете спасение.', NULL, NULL, 25978, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000154, 'Moonlight disappears in the darkness!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Лунный свет исчезает во тьме!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000153, 'A pillar of moonlight appears!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Появляется столп лунного света!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000152, 'Here you will find nothing but death and sorrow.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Здесь вы не найдете ничего, кроме смерти и скорби.', NULL, NULL, 25977, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000150, 'And so ends your story.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Для вас все кончено.', NULL, NULL, 0, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000149, 'Cry havoc!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Смерть всем!', NULL, NULL, 0, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000148, 'This ... isn\'t how it\'s supposed to ... end.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Это... не должно было... кончиться вот так.', NULL, NULL, 25967, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000147, 'Watch, heathens, as death surrounds you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Смотрите, презренные: смерть окружает вас!', NULL, NULL, 25970, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000146, 'Another band of Deathwing\'s converts? I\'ll be sure your death is especially painful.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Новые приспешники Смертокрыла? Ваша смерть будет особенно мучительной.', NULL, NULL, 25966, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000145, '|TInterfaceIconsability_druid_starfall.blp:20|t С неба льются |cFFFF0000|Hspell:102241|h[Tears of Elune]|h|r!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|TInterfaceIconsability_druid_starfall.blp:20|t С неба льются |cFFFF0000|Hspell:102241|h[слезы Элуны]|h|r!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000144, '|TInterfaceIconsability_druid_lunarguidance.blp:20|t Tyrande granted |cFFFF0000|Hspell:102472|h[moon light]|h|r!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|TInterfaceIconsability_druid_lunarguidance.blp:20|t Тиранде даровано |cFFFF0000|Hspell:102472|h[лунное покровительство]|h|r!', NULL, NULL, 0, 3, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000143, 'I can...see the light of the moon...so clearly now. It is...beautiful...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я так... ясно вижу... свет луны. Она... прекрасна...', NULL, NULL, 25976, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000142, 'Mother moon, I can no longer see your light! Your daughter is alone in the darkness!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Мать-луна, я не вижу твоего света! Твоя дочь... заблудилась во тьме!', NULL, NULL, 25975, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000141, 'Eyes of night, pierce this darkness!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Очи богини, пронзите эту тьму!', NULL, NULL, 25983, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000140, 'The darkness closes in...my vision is clouded...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Тьма наступает... Все скрывается во мраке...', NULL, NULL, 25974, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000139, 'Moon goddess, your light dims! I am lost without your guidance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Богиня, твой свет угасает! Я не справлюсь без твоей помощи...', NULL, NULL, 25973, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000138, 'Spear of Elune, drive back the night!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Копье Элуны, заставь отступить ночь!', NULL, NULL, 25984, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000137, 'Let the peaceful light of Elune soothe your souls in this dark time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Пусть свет Элуны дарует покой вашим мятежным душам.', NULL, NULL, 25972, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000136, 'I understand, now. Farewell, and good luck.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Теперь мне все ясно. Прощайте... и удачи вам.', NULL, NULL, 25919, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000135, 'You had better give up.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Лучше тебе было сдаться.', NULL, NULL, 0, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000134, 'You forced me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы вынудили меня.', NULL, NULL, 0, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000133, 'I didn\'t want to do that.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я этого не хотела.', NULL, NULL, 0, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000132, 'I wish you\'d surrendered.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Сдавайтесь!', NULL, NULL, 25926, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000131, 'Perhaps this will cool your heads...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Может быть, это остудит ваши горячие головы…', NULL, NULL, 25924, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000130, 'You asked for it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы об этом пожалеете.', NULL, NULL, 25917, 1, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000129, 'I don\'t know who you are, but I\'ll defend this shrine with my life. Leave, now, before we come to blows.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я не знаю, кто вы, но я готова отдать свою жизнь за это святилище. Уходите, пока дело не дошло до схватки.', NULL, NULL, 25920, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000127, 'Where... is this place? What... have I done? Forgive me, my father...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Где… где я? Что… я наделал? Прости меня, отец…', NULL, NULL, 25910, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000126, 'Suffer for your arrogance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Твоя самонадеянность погубила тебя!', NULL, NULL, 25914, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000125, 'A just punishment.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Справедливое наказание!', NULL, NULL, 25913, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000124, 'This is the price you pay!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Расплата была неизбежна!', NULL, NULL, 25912, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000123, 'My wrath knows no bounds!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Моя ярость безгранична!', NULL, NULL, 25916, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000122, 'There will be no escape!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вам не уйти от возмездия!', NULL, NULL, 25915, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000121, 'What dark horrors have you wrought in this place? By my ancestors\' honor, I shall take you to task!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Взгляните, во что вы превратили это место! Клянусь честью предков, вы заплатите за это!', NULL, NULL, 25909, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000120, 'You! Are you the ones responsible for what has happened here...?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы! То, что здесь произошло – ваших рук дело?..', NULL, NULL, 25911, 6, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000105, 'Ruby Dragonshrine', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Рубиновое святилище драконов', NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000104, 'Obsidian Dragonshrine', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Обсидиановое святилище драконов', NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000103, 'Bronze Dragonshrine', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Бронзовое святилище драконов', NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `custom_texts` VALUES (-2000102, 'Azure Dragonshrine', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Лазурное святилище драконов', NULL, NULL, 0, 0, 0, 0, NULL);
